var title_f33_38_34408="Cerebrovasc dis sickle cell";
var content_f33_38_34408=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F50288&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F50288&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 558px\">",
"   <div class=\"ttl\">",
"    Cerebrovascular complications with their locations in sickle cell disease",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 538px; height: 549px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Cerebrovascular complications of the large and small vessels of the brain and their corresponding territories are shown. The most common complications are cerebral infarcts in major vessels and \"borderzone\" infarctions. \"Borderzone\" infarctions are most common in the areas between the middle (MCA) and anterior cerebral (ACA) arteries, and between the middle and posterior cerebral arteries. Fat embolism and venous side abnormalities are the least common lesions. Small white matter lesions visualized on magnetic resonance imaging can be seen in asymptomatic patients. Aneurysms can often multiply within the \"circle of Willis\". ICA: internal carotid artery, BA: basilar artery.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
