"    Example of negative remodeling",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 403px; height: 253px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Intravascular ultrasound images of the proximal reference and lesion site are shown. The remodeling ratio (EEM area lesion/EEM area proximal reference) is 0.71. EEM, external elastic membrane.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reprinted with permission from: Schoenhagen P, Ziada KM, Vince DG, et al. J Am Coll Cardiol 2001; 38:297. Copyright &copy; 2001 American College of Cardiology.",
"    </div>",
"    <div class=\"contractual\">",
"     <br/>",
"     <a href=\"file://www.elsevier.com/locate/jacc\">",
"      file://www.elsevier.com/locate/jacc",
"     </a>",
"     <br/>",
"     <a href=\" file://www.sciencedirect.com\">",
"      file://www.sciencedirect.com",
"     </a>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Example of positive remodeling",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 431px; height: 262px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
