"   </div>",
"   <div class=\"lgnd\">",
"    Toxoplasma gondii tachyzoites, stained with Giemsa, from a smear of peritoneal fluid obtained from a laboratory-inoculated mouse. Toxoplasma gondii tachyzoites are approximately 4 to 8 micrometers long by 2 to 3 micrometers wide, with a tapered anterior end, a blunt posterior end, and a large nucleus. They may be found in various sites throughout the body of the host.",
